Template.facilityLSPRatings.helpers({
	"facAverageRating":function(){
		//console.log(this);
		var sum = 0;
		var num = 0;
		for(i=0;i<this.options.length;i++){
			num += this.options[i];
			sum += this.options[i]*(i+1);
		}
		//console.log("sum = " + sum);
		//console.log("num = " + num);
		var res = sum/num;
		if (isNaN(res)) res = "-";
		return res;
	},
	
	"testFac":function(a){
		console.log(this);
		console.log(a);
		
		//calculate average rating
		var sum = 0;
		var num = 0;
		for(i=0;i<this.options.length;i++){
			num += this.options[i];
			sum += this.options[i]*(i+1);
		}
		//console.log("sum = " + sum);
		//console.log("num = " + num);
		var avg = sum/num;
		
		
		
		var res = "";
		for(i=0;i<a.length;i++){
			if(Math.round(avg) == (i+1)){
				res += '<label class="radio-inline"><input type="radio" id="optradio" name="qnOptions'+this.qnID+'" value="'+i+'" checked="checked">'+i+"</label>";
			} else{
				res += '<label class="radio-inline"><input type="radio" id="optradio" name="qnOptions'+this.qnID+'" value="'+i+'">'+i+"</label>";
			}
		}
		
		return Spacebars.SafeString(res);
	},
	
	"toBeChecked":function(a){
		console.log(this);
		console.log(a);
		return true;
	}
});

